import axios from 'axios';
import FormData from 'form-data';
import * as actionTypes from './actionTypes';
import {physicianListSuccess} from "./selectPhysician";

export const setPhysicianFilterText = (filterText) => {
  return {
    type: actionTypes.SET_PHY_FILTER_TEXT,
    filter: filterText
  };
};

export const getPhysicianDetailsSuccess = (physicianDetails) => {
  return {
    type: actionTypes.GET_PHYSICIANDETAIL_SUCCESS,
    physicianDetails
  };
};

export const getPhysicianById = (pid, clinicid) => {
  return dispatch => {
    const physicianData = new FormData();
    physicianData.append('city', city);
    if (phyname !== null) {
      physicianData.append('phyname', phyname);
    }
    if (physpecialisation !== null) {
      physicianData.append('specializations', physpecialisation);
    }
    axios.post(actionTypes.API_URL + "Physician/getphysician/", physicianData).then(
      response => {
        // console.log('inside physician data response');
        // console.log("res ***" + JSON.stringify(response.data));
        if (response.data.success === 1) {
          dispatch(physicianListSuccess(Array.from(response.data.result)));
        }
      }).catch(err => {
      console.log(err);
    });
  };
};
